import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";
import Sdata from "./Sdata";
import "./index.css";

ReactDOM.render(
  <>
    <h1 className="heading_style">Top 5 Netflix shows</h1>
        <Card
      imgsrc={Sdata[0].sname}
      link={Sdata[0].sname}
      sname={Sdata[0].sname}
      title={Sdata[0].sname}
    />

  </>,
  document.getElementById("root")
);
